import Link from "next/link";
import Layout from "../components/Layout";
export default () => {
  return (
    <Layout title="Home">
      <h1>Welcome to home page</h1>
      <Link href="/about">About</Link>
      <a href="mailto:snow41438@gmail.com">Snow white</a>
      <img src="/static/image.png" alt="image" height="200px" />
    </Layout>
  );
};
